script: |
  super -f text -I q10275.spq | sort > q10275.out

inputs:
  - name: q10275.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 + ( - ( ( + + col0 ) ) ) * - 14 <= 36;
  - name: tab2

outputs:
  - name: q10275.out
    data: |
      46	51	23
      64	77	40
      75	67	58
